  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset was originally provided to
  the staff of LIBI and the Intermountain Region GIS Program Office, National Park
  Service free of charge, for their appropriate use as a buildings GIS dataset. NPS
  park personnel copied the file and isolated features that were part of the park's
  old sewer system. The Little Bighorn Battlefield National Monument (LIBI) GIS program
  was created from academic research and coursework in the Department of Economics
  and Geography, United States Air Force Academy (USAFA). The GIS data developed for
  LIBI was complied from hardcopy maps and blueprints provided by the LIBI staff and
  softcopy data available from the US Census Bureau. This dataset captures the older
  sewer system areas not currently in use at LIBI as marked on the Potable Water and
  Fire Portection Lines Blueprint #381/41002A sheet 2 of 11.\",\n\t\"license_title\":
